import React from 'react'
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import ListItemText from '@mui/material/ListItemText';
import Select from '@mui/material/Select';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';
import { Formik, Form, Field, ErrorMessage } from 'formik';


// Multi-Select
const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
    PaperProps: {
        style: {
            maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
            width: 250,
        },
    },
};
const names = [
    'Writing',
    'Marketing',
    'Blogging',
    'Learning languages',
    'Photography',
    'Travel',
    'Sports',
    'Yoga',
    'Dance',
];


// DropeDown
const country = [
    { label: 'Indai' },
    { label: 'US' },
    { label: 'UK' },
    { label: 'Canada' },
    { label: 'China' },

];
const Input = () => {


    // Multi-Select
    const [personName, setPersonName] = React.useState([]);

    const handleChange = (event) => {
        const {
            target: { value },
        } = event;
        setPersonName(
            // On autofill we get a stringified value.
            typeof value === 'string' ? value.split(',') : value,
        );
    };

    const initialvalues={
        name:'',
        country:'',
        hobbiesInterests:'',
        gender:'',
        Address:''
    }

    return (
        <div className='Container'>
            <Formik  initialvalues={initialvalues} >
                {(props) => (
                    <form>
                        {/* username */}
                        <TextField id="outlined-basic" name='name' label="User's name" variant="outlined" fullWidth required />


                        {/* Country */}
                        <Autocomplete fullWidth
                            id="combo-box-demo"
                            name='country'
                            options={country}
                            renderInput={(params) => <TextField {...params} label="Country" />}
                        />



                        {/* Hobbies and Interests */}
                        <FormControl fullWidth>
                            <InputLabel name='hobbiesInterests' id="demo-multiple-checkbox-label">Hobbies & Interests</InputLabel>
                            <Select
                                labelId="demo-multiple-checkbox-label"
                                id="demo-multiple-checkbox"
                                multiple
                                value={personName}
                                onChange={handleChange}
                                input={<OutlinedInput label="Hobbies and Interests" />}
                                renderValue={(selected) => selected.join(', ')}
                                MenuProps={MenuProps}
                            >
                                {names.map((name) => (
                                    <MenuItem key={name} value={name}>
                                        <Checkbox checked={personName.indexOf(name) > -1} />
                                        <ListItemText primary={name} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                        <br></br>


                        {/* Gender  */}
                        <FormLabel name='gender' id="demo-row-radio-buttons-group-label">Gender</FormLabel>
                        <RadioGroup
                            row
                            aria-labelledby="demo-row-radio-buttons-group-label"
                            name="row-radio-buttons-group"
                        >
                            <FormControlLabel value="female" control={<Radio />} label="Female" />
                            <FormControlLabel value="male" control={<Radio />} label="Male" />
                            <FormControlLabel value="other" control={<Radio />} label="Other" />

                        </RadioGroup>
                        <br></br>


                        {/* Address */}
                        <TextField fullWidth
                        name='address'
                            id="outlined-multiline-static"
                            label="Address"
                            multiline
                            rows={4}
                            defaultValue=""
                        />

                        <Button type='submit' variant="contained">Submit</Button>
                    </form>
                )}


            </Formik>
        </div>
    )
}

export default Input
